// Components
import { Button, Space, toast } from '@derbysoft/neat-design';

export default () => {
    const [toastApi, contextHolder] = toast.useToast({
        duration: 0,
    });

    const info = () => {
        toastApi.open({
            type: 'info',
            content: 'This is an info toast',
        });
    };

    const success = () => {
        toastApi.open({
            type: 'success',
            content: 'This is a success toast',
        });
    };

    const warning = () => {
        toastApi.open({
            type: 'warning',
            content: 'This is a warning toast',
        });
    };

    const error = () => {
        toastApi.open({
            type: 'error',
            content: 'This is an error toast',
        });
    };

    return (
        <>
            {contextHolder}
            <Space>
                <Button onClick={info}>Info</Button>
                <Button onClick={success}>Success</Button>
                <Button onClick={warning}>Warning</Button>
                <Button onClick={error}>Error</Button>
            </Space>
        </>
    );
};
